import React, { useState } from "react";
import { AppBar, Toolbar, Button, Box, Typography, Select, MenuItem, TextField } from "@mui/material";
import logo from "./logo1.png"; // Import the logo image

function App() {
  // State for job type and location
  const [jobType, setJobType] = useState("");
  const [location, setLocation] = useState("");

  const handleJobTypeChange = (event) => {
    setJobType(event.target.value);
  };

  const handleLocationChange = (event) => {
    setLocation(event.target.value);
  };

  const handleSearch = () => {
    console.log(`Searching for ${jobType} jobs in ${location}`);
    // Implement the search functionality here
  };

  return (
    <>
      {/* Navigation Bar */}
      <AppBar position="static">
        <Toolbar sx={{ display: "flex", justifyContent: "space-between" }}>
          {/* Left Side: Logo Image and Navigation Buttons */}
          <Box sx={{ display: "flex", alignItems: "center" }}>
            {/* Logo Image */}
            <img src={logo} alt="Company Logo" style={{ height: "40px", marginRight: "20px" }} />

            <Box sx={{ "& > *": { margin: "0 10px" } }}>
              <Button color="inherit">Home</Button>
              <Button color="inherit">About</Button>
              <Button color="inherit">Jobs</Button>
              <Button color="inherit">Boost</Button>
              <Button color="inherit">Prep</Button>
              <Button color="inherit">Learn</Button>
              <Button color="inherit">Career Advice</Button>
              <Button color="inherit">Certification</Button>
            </Box>
          </Box>

          {/* Right Side: Auth Buttons */}
          <Box sx={{ "& > *": { margin: "0 10px" } }}>
            <Button color="inherit">Recruiter</Button>
            <Button color="inherit">Jobseeker</Button>
            <Button color="inherit">Login</Button>
            <Button color="inherit">Register</Button>
          </Box>
        </Toolbar>
      </AppBar>

      {/* Second Layout: Job Search Section */}
      <Box sx={{ padding: "20px", textAlign: "center" }}>
        <Typography variant="h4" gutterBottom>
          Search for Jobs
        </Typography>

        {/* Job Type Select */}
        <Select
          value={jobType}
          onChange={handleJobTypeChange}
          displayEmpty
          sx={{ width: "200px", marginRight: "20px" }}
        >
          <MenuItem value="" disabled>
            Select Job Type
          </MenuItem>
          <MenuItem value="Part-time">Part-time</MenuItem>
          <MenuItem value="Full-time">Full-time</MenuItem>
          <MenuItem value="Front-end">Front-end</MenuItem>
          <MenuItem value="Back-end">Back-end</MenuItem>
          <MenuItem value="Full-stack">Full-stack</MenuItem>
        </Select>

        {/* Location Select */}
        <Select
          value={location}
          onChange={handleLocationChange}
          displayEmpty
          sx={{ width: "200px", marginRight: "20px" }}
        >
          <MenuItem value="" disabled>
            Select Location
          </MenuItem>
          <MenuItem value="Bangalore">Bangalore</MenuItem>
          <MenuItem value="Hyderabad">Hyderabad</MenuItem>
          <MenuItem value="Pune">Pune</MenuItem>
        </Select>

        {/* Search Button */}
        <Button
          variant="contained"
          color="primary"
          onClick={handleSearch}
          sx={{ height: "40px", marginTop: "-3px" }}
        >
          Search
        </Button>
      </Box>
    </>
  );
}

export default App;
